var images = [ ];
var imagesCount = 0;
var nextImageId = 0;

function removeImageById(id) {
    for (var i = 0; i < imagesCount; i++) {
        if (images[i].id == id) {
            images.splice(i, 1);
            imagesCount--;
            break;
        }
    }
    console.log(images);
}

function strNotEmpty(str) {
    return typeof str === "string" && str.length !== 0;
}

function getImageById(id) {
    for (var i = 0; i < imagesCount; i++) {
        if (images[i].id == id) return images[i];
    }
}

