function addImage(url) {
    if (!url.startsWith("data:image")) {
        console.log("Converting url...");
        var xhr = new XMLHttpRequest();
        xhr.onload = function() {
            var fileReader = new FileReader();

            fileReader.onloadend = function() {
                addImage(fileReader.result);
            }

            fileReader.readAsDataURL(xhr.response);
        };

        xhr.open("GET", url);
        xhr.responseType = "blob";
        xhr.send();
        return;
    }

    var img = new Image();
    img.onload = function() {
        imagesCount++;
        nextImageId++;

        var image = {
            id: nextImageId,
            src: url,
            width: img.width,
            height: img.height
        };

        images[imagesCount - 1] = image;

        console.log(
            "Image with id " + image.id +
            " (" + image.width + "x" + image.height +
            ") added to images!");

        showImage(image.id);
    };
    img.src = url;
}

function addImages(urls) {
    for (var i in urls) {
        addImage(urls[i]);
    }
}

function loadImagesByDragAndDrop(dataTransfer) {
    if (dataTransfer.items[0].kind != "file") {
        var imageUrl = dataTransfer.getData("application/x-moz-file-promise-url");
            imageUrl =
            strNotEmpty(imageUrl) ?
            imageUrl : dataTransfer.getData("text/uri-list");
        if (strNotEmpty(imageUrl)) addImage(imageUrl);
        return;
    }

    for (var i = 0; i < dataTransfer.files.length; i++) {
        var file = dataTransfer.files[i];

        var fileReader = new FileReader();
        fileReader.readAsDataURL(file);

        fileReader.onload = function(e) {
            addImage(e.target.result);
        };
    }
}

function translateStatus(status) {
    switch (status) {
        case "loading tesseract core":
            return "Загрузка ядра Tesseract";
        case "initializing tesseract":
            return "Инициализация Tesseract";
        case "initialized tesseract":
            return "Запуск Tesseract";
        case "initializing api":
            return "Инициализация API";
        case "loading language traineddata":
            return "Загрузка языковой модели";
        case "loaded language traineddata":
            return "Запуск языковой модели";
        case "recognizing text":
            return "Распознавание текста";
        default:
            return status;
    }
}

function copyToClipboard(id) {
    var range = document.createRange();
    range.selectNode(document.getElementById("ocr" + id));
    window.getSelection().removeAllRanges();
    window.getSelection().addRange(range);
    document.execCommand("copy");
    window.getSelection().removeAllRanges();
}

function progressUpdate(packet, id) {
	var log = document.getElementById("ocr" + id);

	if (log.firstChild && log.firstChild.status === packet.status) {
		if ("progress" in packet) {
			var progress = log.firstChild.querySelector("progress");
			progress.value = packet.progress;
		}
	} else {
		var line = document.createElement("div");
		line.status = packet.status;
		var status = document.createElement("div");
		status.className = "status";

		status.appendChild(document.createTextNode(translateStatus(packet.status)));
		line.appendChild(status);

		if ("progress" in packet) {
			var progress = document.createElement("progress");
			progress.value = packet.progress;
			progress.max = 1;
			line.appendChild(progress);
		}

		if (packet.status == "done") {
			log.innerHTML = "";
			var pre = document.createElement("pre");
			pre.appendChild(document.createTextNode(packet.data.text.replace(/\n\s*\n/g, '\n')));
			line.innerHTML = "";
			line.appendChild(pre);
		}

		log.insertBefore(line, log.firstChild);
	}
}

function recognizeImage(id) {
    var image = getImageById(id);
    if (typeof image === "undefined") {
        console.log(
            "Recognize image failed! Image with id " + id + " not found!");
            return;
    }

    var img = document.getElementById("img" + id);

  	const corePath = window.navigator.userAgent.indexOf("Edge") > -1 ?
    "js/tesseract-core.asm.js" : "js/tesseract-core.wasm.js";
    const worker = new Tesseract.TesseractWorker({ corePath });

	worker.recognize(
        img,
        [
            "rus", "eng",
            //"fra", "deu", "ukr", "ita", "tur", "afr", "ara", "aze", 
            //"chi_sim", "chi_tra", "chr", "dan", "ben", "ell", "enm", "cat", "epo", "ces",
            //"equ", "est", "eus", "fin", "vie", "frk", "frm", "glg", "grc", "heb",
            //"hin", "hrv", "hun", "ind", "isl", "bel", "ita_old", "jpn", "kan", "kor",
            //"lav", "lit", "mal", "mkd", "mlt", "msa", "nld", "nor", "pol", "por",
            //"ron", "slk", "slv", "spa", "spa_old", "sqi", "srp", "swa", "swe", "tam",
            //"tel", "tgl", "tha", "bul"
        ])
    .progress(function(packet) {
        console.info(packet);
        progressUpdate(packet, id)
    })
    .then(function(data) {
        console.info(data);
        progressUpdate({ status: "done", data: data }, id);
    });
}

function removeImage(id) {
    var image = getImageById(id);
    if (typeof image === "undefined") {
        console.log(
            "Remove image failed! Image with id " + id + " not found!");
            return;
    }
    removeImageById(id);

    $("#result" + id).remove();
}

$(document).ready(function() {
    $(".app-loadzone__header")
    .on("dragenter", function(e) {
        e.preventDefault();

        $(this).css("background", "#BBD5B8");
    })
    .on("dragover", function(e) {
        e.preventDefault();
    })
    .on("dragleave", function(e) {
        e.preventDefault();

        $(this).css("background", "white");
    })
    .on("drop", function(e) {
        e.preventDefault();

        $(this).css("background", "#D8F9D3");

        var dataTransfer = e.originalEvent.dataTransfer;
        loadImagesByDragAndDrop(dataTransfer);
    });

    document.querySelector("#files").addEventListener("change", (e) => { 
        if (window.File && window.FileReader && window.FileList && window.Blob) {
            var files = e.target.files;

            for (var i = 0; i < files.length; i++) {
                if (!files[i].type.match("image")) continue;

                var fileReader = new FileReader();
                fileReader.addEventListener("load", function (event) {
                    var file = event.target;
                    addImage(file.result);
                });
                fileReader.readAsDataURL(files[i]);
            }
        } else {
            alert("Ваш браузер не поддерживает File API");
        }
    });

    addImages([
        "data:image/png;base64,",
        "data:image/png;base64,"
        ]);
});
